import{_ as s,c as a,b as l,o as n}from"./chunks/framework.B1z0IdBH.js";const h=JSON.parse('{"title":"DeepSpace","description":"","frontmatter":{},"headers":[{"level":2,"title":"Features","slug":"features","link":"#features","children":[]},{"level":2,"title":"Installation","slug":"installation","link":"#installation","children":[{"level":3,"title":"Install using the go command","slug":"install-using-the-go-command","link":"#install-using-the-go-command","children":[]},{"level":3,"title":"Download Executable from the Releases Page","slug":"download-executable-from-the-releases-page","link":"#download-executable-from-the-releases-page","children":[]}]},{"level":2,"title":"Usage","slug":"usage","link":"#usage","children":[{"level":3,"title":"Starting the Service","slug":"starting-the-service","link":"#starting-the-service","children":[]}]}],"relativePath":"guide/deepspace/README.md","filePath":"guide/deepspace/README.md"}'),o={name:"guide/deepspace/README.md"};function t(p,e,r,c,i,d){return n(),a("div",null,e[0]||(e[0]=[l(`<h1 id="deepspace" tabindex="-1">DeepSpace <a class="header-anchor" href="#deepspace" aria-label="Permalink to &quot;DeepSpace&quot;">​</a></h1><p>DeepSpace is a tool for debugging the DeepSeek API, developed by the community and inspired by <a href="https://github.com/MoonshotAI/moonpalace?tab=readme-ov-file" target="_blank" rel="noreferrer">MoonPalace</a>.</p><p><a href="./README_cn.html">简体中文</a></p><h2 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;">​</a></h2><ul><li><strong>Cross-platform Support:</strong><ul><li>[x] Mac</li><li>[x] Windows</li><li>[x] Linux</li></ul></li><li><strong>User-friendly</strong>: Simply replace <code>base_url</code> with <code>http://localhost:9988</code> after starting the service to begin debugging.</li><li><strong>Complete Request Capture</strong>, including error details in case of network failures.</li><li><strong>Fast Retrieval</strong>: Quickly search and view request information using <code>request_id</code> or <code>chatcmpl_id</code>.</li><li><strong>One-click Export of Structured BadCase Reports</strong>, aiding DeepSeek in enhancing model capabilities.</li></ul><p><strong>It is recommended to use DeepSpace as your API “provider” during code development and debugging stages. This allows you to quickly identify and resolve issues related to API calls and code implementation. For any unexpected outputs from the DeepSeek large model, you can also export request details via DeepSpace and submit them to DeepSeek to help improve the model.</strong></p><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><h3 id="install-using-the-go-command" tabindex="-1">Install using the <code>go</code> command <a class="header-anchor" href="#install-using-the-go-command" aria-label="Permalink to &quot;Install using the \`go\` command&quot;">​</a></h3><p>If you have the <code>go</code> toolchain installed, you can install DeepSpace by executing the following command:</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki github-dark vp-code" tabindex="0"><code><span class="line"><span style="color:#B392F0;">$</span><span style="color:#9ECBFF;"> go</span><span style="color:#9ECBFF;"> install</span><span style="color:#9ECBFF;"> github.com/2404589803/deepspace@latest</span></span></code></pre></div><p>This command will install the compiled binary in your <code>$GOPATH/bin/</code> directory. To verify the installation, run the following command:</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki github-dark vp-code" tabindex="0"><code><span class="line"><span style="color:#B392F0;">$</span><span style="color:#9ECBFF;"> deepspace</span></span>
<span class="line"><span style="color:#B392F0;">DeepSpace</span><span style="color:#9ECBFF;"> is</span><span style="color:#9ECBFF;"> a</span><span style="color:#9ECBFF;"> command-line</span><span style="color:#9ECBFF;"> tool</span><span style="color:#9ECBFF;"> for</span><span style="color:#9ECBFF;"> debugging</span><span style="color:#9ECBFF;"> the</span><span style="color:#9ECBFF;"> DeepSeek</span><span style="color:#9ECBFF;"> AI</span><span style="color:#9ECBFF;"> HTTP</span><span style="color:#9ECBFF;"> API</span></span>
<span class="line"></span>
<span class="line"><span style="color:#B392F0;">Usage:</span></span>
<span class="line"><span style="color:#B392F0;">  deepspace</span><span style="color:#E1E4E8;"> [command]</span></span>
<span class="line"></span>
<span class="line"><span style="color:#B392F0;">Available</span><span style="color:#9ECBFF;"> Commands:</span></span>
<span class="line"><span style="color:#B392F0;">  cleanup</span><span style="color:#9ECBFF;">     Cleanup</span><span style="color:#9ECBFF;"> DeepSeek</span><span style="color:#9ECBFF;"> AI</span><span style="color:#9ECBFF;"> requests</span></span>
<span class="line"><span style="color:#B392F0;">  completion</span><span style="color:#9ECBFF;">  Generate</span><span style="color:#9ECBFF;"> the</span><span style="color:#9ECBFF;"> autocompletion</span><span style="color:#9ECBFF;"> script</span><span style="color:#9ECBFF;"> for</span><span style="color:#9ECBFF;"> the</span><span style="color:#9ECBFF;"> specified</span><span style="color:#9ECBFF;"> shell</span></span>
<span class="line"><span style="color:#F97583;">  export</span><span style="color:#E1E4E8;">      Export a DeepSeek AI request</span></span>
<span class="line"><span style="color:#B392F0;">  help</span><span style="color:#9ECBFF;">        Help</span><span style="color:#9ECBFF;"> about</span><span style="color:#9ECBFF;"> any</span><span style="color:#9ECBFF;"> command</span></span>
<span class="line"><span style="color:#B392F0;">  inspect</span><span style="color:#9ECBFF;">     Inspect</span><span style="color:#9ECBFF;"> the</span><span style="color:#9ECBFF;"> specific</span><span style="color:#9ECBFF;"> content</span><span style="color:#9ECBFF;"> of</span><span style="color:#9ECBFF;"> a</span><span style="color:#9ECBFF;"> DeepSeek</span><span style="color:#9ECBFF;"> AI</span><span style="color:#9ECBFF;"> request</span></span>
<span class="line"><span style="color:#B392F0;">  list</span><span style="color:#9ECBFF;">        Query</span><span style="color:#9ECBFF;"> DeepSeek</span><span style="color:#9ECBFF;"> AI</span><span style="color:#9ECBFF;"> requests</span><span style="color:#9ECBFF;"> based</span><span style="color:#9ECBFF;"> on</span><span style="color:#9ECBFF;"> conditions</span></span>
<span class="line"><span style="color:#B392F0;">  start</span><span style="color:#9ECBFF;">       Start</span><span style="color:#9ECBFF;"> the</span><span style="color:#9ECBFF;"> DeepSpace</span><span style="color:#9ECBFF;"> proxy</span><span style="color:#9ECBFF;"> server</span></span>
<span class="line"></span>
<span class="line"><span style="color:#B392F0;">Flags:</span></span>
<span class="line"><span style="color:#B392F0;">  -h,</span><span style="color:#79B8FF;"> --help</span><span style="color:#9ECBFF;">      help</span><span style="color:#9ECBFF;"> for</span><span style="color:#9ECBFF;"> deepspace</span></span>
<span class="line"><span style="color:#B392F0;">  -v,</span><span style="color:#79B8FF;"> --version</span><span style="color:#9ECBFF;">   version</span><span style="color:#9ECBFF;"> for</span><span style="color:#9ECBFF;"> deepspace</span></span>
<span class="line"></span>
<span class="line"><span style="color:#B392F0;">Use</span><span style="color:#9ECBFF;"> &quot;deepspace [command] --help&quot;</span><span style="color:#9ECBFF;"> for</span><span style="color:#9ECBFF;"> more</span><span style="color:#9ECBFF;"> information</span><span style="color:#9ECBFF;"> about</span><span style="color:#9ECBFF;"> a</span><span style="color:#9ECBFF;"> command.</span></span></code></pre></div><p><em>If the <code>deepspace</code> binary is not found, try adding the <code>$GOPATH/bin/</code> directory to your <code>$PATH</code> environment variable.</em></p><h3 id="download-executable-from-the-releases-page" tabindex="-1">Download Executable from the Releases Page <a class="header-anchor" href="#download-executable-from-the-releases-page" aria-label="Permalink to &quot;Download Executable from the Releases Page&quot;">​</a></h3><p>Alternatively, you can download the precompiled binary from the <a href="https://github.com/2404589803/deepspace/releases" target="_blank" rel="noreferrer">Releases</a> page:</p><ul><li>deepspace-linux</li><li>deepspace-macos-amd64 =&gt; for Intel-based Macs</li><li>deepspace-macos-arm64 =&gt; for Apple Silicon-based Macs</li><li>deepspace-windows.exe</li></ul><h2 id="usage" tabindex="-1">Usage <a class="header-anchor" href="#usage" aria-label="Permalink to &quot;Usage&quot;">​</a></h2><h3 id="starting-the-service" tabindex="-1">Starting the Service <a class="header-anchor" href="#starting-the-service" aria-label="Permalink to &quot;Starting the Service&quot;">​</a></h3><p>Use the following command to start the DeepSpace proxy server:</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki github-dark vp-code" tabindex="0"><code><span class="line"><span style="color:#B392F0;">$</span><span style="color:#9ECBFF;"> deepspace</span><span style="color:#9ECBFF;"> start</span><span style="color:#79B8FF;"> --port</span><span style="color:#F97583;"> &lt;</span><span style="color:#9ECBFF;">POR</span><span style="color:#E1E4E8;">T</span><span style="color:#F97583;">&gt;</span></span></code></pre></div><p>DeepSpace will start a local HTTP server. The <code>--port</code> parameter specifies the local port that DeepSpace listens to, with a default value of <code>9988</code>. Upon successful startup, the following message will be displayed:</p><div class="language-shell"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki github-dark vp-code" tabindex="0"><code><span class="line"><span style="color:#E1E4E8;">[DeepSpace] 2024/08/26 12:12:26 DeepSpace Starts =</span><span style="color:#F97583;">&gt;</span><span style="color:#E1E4E8;"> change base_url to </span><span style="color:#9ECBFF;">&quot;http://127.0.0.1:9988/v1&quot;</span></span></code></pre></div><p>You can submit the exported files to the following email:</p><p><a href="mailto:api-service@deepseek.com" target="_blank" rel="noreferrer">api-service@deepseek.com</a></p>`,24)]))}const u=s(o,[["render",t]]);export{h as __pageData,u as default};
